import React from "react";
import { FirstName, LastName } from "./App";

const ComF = () => {
  return (
    <div>
      <FirstName.Consumer>
        {(fname) => {
          return (
            <LastName.Consumer>
              {(lanme) => {
                return <h1> My FirstName is {fname}  {} </h1>;
              }}
            </LastName.Consumer>
          );
        }}
      </FirstName.Consumer>
    </div>
  );
};

export default ComF;
